import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Main_Home_File from './screens/Main_Screen_Files/Main_Home_File'
import Main_Account_File from "./screens/Main_Screen_Files/Main_Accont_File";
import Main_Login_File from "./screens/Main_Screen_Files/Main_Login_file";
import Main_Singup_File from "./screens/Main_Screen_Files/Main_Signup_File";

const App=()=>{
  return(
    <BrowserRouter>
      <Routes>
        <Route index element={<Main_Home_File />} />
        <Route path="./screens/Main_Screen_Files/Main_Login_File" element={<Main_Login_File />} />
        <Route path="./screens/Main_Screen_Files/Main_Singup_File" element={<Main_Singup_File />} />
        <Route path="./screens/Main_Screen_Files/Main_Account_File" element={<Main_Account_File />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
